import React, { useEffect } from 'react';
import { listsongs } from '../json/songs';

function SongList() {

    const { songs } = listsongs;
    console.log(songs)
    return (
        <div>
            <h3>Songs List</h3>
            {
                songs.sort((song1,song2)=>song2.year-song1.year)
                .map((song,idx) => (
                    <div key={idx}>{song.title}</div>
                ))
            }
        </div>
    )
}

export default SongList;
